INSERT INTO `wancll_annoncements` VALUES ('1', '6', '韩正义党党鞭涉\"网络水军案\"跳楼 否认干非法勾当', '', '', '', '[]', '<header><h1>韩正义党党鞭涉&quot;网络水军案&quot;跳楼 否认干非法勾当</h1><p><a href=\"https://m.haiwainet.cn/ttc/3541083/2018/0724/content_31359718_1.html#\">北京青年报</a>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; 07-24 06:53&nbsp;&nbsp; &nbsp; &nbsp;</p></header><p style=\"white-space: normal;\"><br/></p><p><article><p class=\"imgs_c\"><img title=\"1532386450835894.jpg\" alt=\"0c39934f2cf33b8e1104970bf304234b.jpg\" src=\"http://v4.wx.wygoo.com/public/upload/ueditor/image/20180724/1532401024112571.jpg\"/></p><p>当地时间23日，韩国首尔，警方在鲁会灿跳楼现场进行调查 供图/视觉中国</p><p>韩国首都首尔警方23日说，在野党正义党党鞭、国会议员鲁会灿当天上午在公寓楼跳楼自尽。</p><p>鲁会灿是韩国劳工运动代表性人物，以清廉形象著称，最近却因牵涉搅动政坛的“网络水军案”接受调查，被指两年前非法收受5000万韩元(约合30万元人民币)政治捐款。警方说，不会作尸检，原因是鲁会灿死亡没有可疑之处，而且家人不同意。</p><p><strong>警方称不会作尸检</strong></p><p>警方官员说，当天上午9时38分，首尔市中心一座公寓楼的保安金某在大门附近发现鲁会灿的尸体，立即报警。</p><p>“我听到砰的一响，然后就在那儿发现了鲁议员，”金某说，“我立即向警方报告这起事件，没有碰任何东西。警察告诉我去看看他还有没有脉搏，我试着做了，但是没有脉搏，尽管当时他摔到地上只有一两分钟。”</p><p>警方稍后在公寓楼17层和18层之间的楼梯间发现一件夹克衫，里面有装着鲁会灿身份证件和名片的钱包，以及一封遗书。</p><p>鲁会灿在遗书中承认拿钱，但否认干非法勾当。他在遗书中写道，他收了那笔钱，但是与任何“不当请求”无关。他对不起自己的家人。</p><p>鲁会灿的母亲和一个兄弟住在这座公寓楼里。</p><p>警方说，不会作尸检，原因是鲁会灿死亡没有可疑之处，而且家人不同意。按照家人的意愿，遗书其他部分不会公开。</p><p>鲁会灿是韩国自前总统卢武铉2009年5月因家人卷入腐败丑闻而跳崖以来，自杀身亡的最知名政治人物。</p><p><strong>经常犀利揭露体制内腐败</strong></p><p>鲁会灿61岁，劳工维权人士出身，三次当选国会议员，是韩国劳工运动和进步派政治标志性人物之一。他经常犀利揭露和尖锐抨击体制内腐败，人气很高。</p><p>只是，鲁会灿近期卷入网络水军案，涉嫌收受非法献金一事，接受检察部门调查，一直以来的清廉形象黯然失色。</p><p>网络水军案主角是博客博主金某，网名“Druking”。检方指认，金某及其团队借助电脑程序在网络新闻下捏造留言和评论，目的是在政治热点议题上操控民意，使舆情有利于现执政党共同民主党。</p><p>警方调查发现，金某与执政党、青瓦台官员有联系，其中包括上月当选庆尚南道知事的前议员、总统文在寅的心腹金庆洙。</p><p>检方指认，金某的亲信都某2016年向鲁会灿非法捐款5000万韩元，并安排金某和鲁会灿见面。韩联社报道，鲁会灿曾经从金某活动的网络论坛获得2000万韩元(12万元人民币)演讲费。</p><p>鲁会灿否认上述指认。首尔一家法院19日拒绝批准特别检察官逮捕都某。</p><p>警方和检方2016年联合调查鲁会灿所涉非法献金案，但没有起诉。</p><p>作为网络水军案调查的一部分，特别检察官许益范(音译)带领特别检察组开始重新调查这起案件，发现都某向调查人员提交伪造证据，致使检方两年前没能提出起诉。</p><p><strong>朝野各党党鞭取消会议</strong></p><p>许益范对鲁会灿之死表达哀悼。他告诉媒体记者，他个人“尊重”鲁会灿，这一“悲剧性消息”令他痛苦。“我为他的灵魂祈祷，向他的家人表达哀悼。”系着黑色领带的许益范在镜头前深深低下头。</p><p>青瓦台同样对鲁会灿之死表达哀悼。“这是令人心碎的事件，”青瓦台发言人金宜谦说，“我希望鲁议员安息。”青瓦台宣布，文在寅取消原定当天听取和回复网络请愿的互联网广播节目。</p><p>鲁会灿所在的正义党说：“对他的逝去，没有语言能够表达悲伤。”正义党当天晚些时候举行紧急会议。</p><p>正义党和另一个在野小党民主和平党今年3月组成议会党团，由鲁会灿担任代表。</p><p>共同民主党发言人白惠莲说：“鲁会灿自上世纪90年代以来就致力于进步派政治，是韩国历史上进步派政治的象征。”</p><p>保守派的最大在野党自由韩国党说，鲁会灿之死是“韩国政治的一个悲剧”，“他作为政治家树立了一个关心普通民众和劳工的榜样”，朝野政党应当延续鲁会灿对政治改革和发展的热忱。</p><p>朝野各党党鞭原定当天上午开会，商讨促进在国会的合作，但在鲁会灿坠楼身亡后取消会议。</p></article></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\">31359718,.韩正义党党鞭涉&quot;网络水军案&quot;跳楼 否认干非法勾当,.2018-07-24 06:53:52,.204233,.耿佩,.toutiao</p><p><br/></p>', '', '', '2018-07-24 11:54:09', '2018-07-31 00:00:00', '2018-07-24 11:54:06', '1', '1', '2018-07-24 11:54:03', '2018-09-10 11:38:57');
