INSERT INTO `wancll_annoncements` VALUES ('3', '29', '外交习语|听！习近平讲非洲故事', '龙', '9月3日至4日举行的2018年中非合作论坛北京峰会，将是中国今年举办的规模最大、外国领导人出席最多的主场外交，也是中非友好大家庭的又一次大团圆，更是中非关系更上一层楼的一座里程碑。\n\n　　这几年，习近平主席在不同场合讲过许多精彩的中非友好故事。下面，我们一起回顾和聆听。', '/public/upload/article_images/20180903/fbfd5680501cc9c25031ad53df8ef33d.png', '[]', '<p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\"><span style=\"font-weight: 600 !important;\"><span style=\"color:navy\">故事1：塞内加尔老人“圆梦”宁夏</span></span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“2013年，65岁的塞内加尔老人比拉马参加‘感知中国’知识竞赛。他从全球25万名参赛者中脱颖而出，获得了最高奖，并被邀请到中国旅游，实现了多年的访华夙愿。”</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">——2018年7月20日，习近平主席在塞内加尔《太阳报》发表题为《中国和塞内加尔团结一致》的署名文章</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">“故事里的事”：</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“感知中国”知识竞赛由中国媒体发起，对中国一直兴趣浓厚的比拉马积极报名参赛。作为特等奖的获得者，他得到了去“塞上江南”宁夏旅游的机会，从而圆了自己的“中国梦”。首次访华给这位非洲老人留下了美好而深刻的印象。在著名景点沙坡头，他说：“乘坐沙漠冲浪车时的颠簸，让我想到了巴黎-达喀尔汽车拉力赛－－为了夺得桂冠或者仅仅是完成比赛，勇敢的车手们必须驱车穿过大片的沙漠。这真是了不起的壮举。”</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><img id=\"{9BF320B3-8D57-4C32-A822-ABC81CCF0828}\" title=\"\" src=\"http://www.xinhuanet.com/world/2018-09/01/129944882_15357688533731n.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><span style=\"color:navy;font-family:楷体\">2017年12月8日，宁夏沙坡头景区内腾格里沙漠一景。新华社记者 隋先凯摄</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\"><span style=\"color:navy\">故事2：津巴布韦儿童“非爱不可”</span></span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“据我了解，旅居津巴布韦的华侨中间有一个名为‘非爱不可’（Love of Africa）的妈妈团体，还有一位连车牌号都被当地孩子熟知的‘程爸爸’（Father Cheng）。他们多年如一日给当地孤儿送去关爱和温暖，用实际行动书写着中津友好的‘现在时’，也培育着中津友好的‘将来时’。”</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">——2015年11月30日，习近平主席在津巴布韦《先驱报》发表题为《让中津友谊绽放出更加绚丽的芳华》的署名文章</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">“故事里的事”：</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“非爱不可”爱心妈妈团成立于2014年，是津巴布韦华商会名下的一个公益慈善组织，旨在帮助津巴布韦的弱势儿童改善学习和生活条件。短短几年时间，“非爱不可”爱心妈妈团为津巴布韦几十家孤儿院捐助食品、生活用品和娱乐设施，为50多个孤儿筹集学费。2016年8月，“非爱不可”爱心妈妈团还在哈拉雷北郊的贫民区捐建一所孤儿院，接收12名孤儿。一系列大爱无疆的善举得到了津巴布韦政府和老百姓的称赞。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><img id=\"{66FF3C84-7F1E-4FC4-9D27-8A653C21EC80}\" title=\"\" src=\"http://www.xinhuanet.com/world/2018-09/01/129944882_15357690679031n.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"color:navy;font-family:楷体\">2016年8月12日，一名津巴布韦儿童在“非爱不可”爱心妈妈团捐建的孤儿院内感受新的双层木板床。新华社记者 许林贵摄</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\"><span style=\"color:navy\">故事3：中国玉树有个“刚果小学”</span></span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“2010年4月，中国青海玉树发生强烈地震后，刚果政府慷慨解囊，向灾区捐建了一所小学，萨苏总统亲自将其命名为‘中刚友谊小学’。现在，灾区的孩子们有了宽敞的新校舍，他们可以安静读书学习，在运动场上奔跑欢笑。该校全体学生在写给萨苏总统的感谢信中动情地说：‘鸟儿因为有了天空的广阔而更加自由，骏马因为有了草原的宽广而更加健壮，鲜花因为有了阳光雨露而更加艳丽，我们的生活因为有了刚果政府和人民的帮助而更加美好。’”</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">——2013年3月29日，习近平主席在刚果共和国议会发表题为《共同谱写中非人民友谊新篇章》的演讲</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“故事里的事”：</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　2010年4月14日，中国玉树发生地震。月底，在参加上海世博会开幕式时，刚果共和国总统萨苏表示希望在玉树灾区捐建一所小学。中方考虑到玉树位于青藏高原，捐建一所完整的寄宿小学成本较高、对刚果负担较重，因此建议仅捐建一座教学楼或图书馆。但萨苏随即表示：“不，刚果要捐建的是一所小学，一所完整的小学，不管造价多高，刚果都会承担。”经双方协商，刚果共和国捐赠1600万元人民币用于建设中刚友谊小学。学校占地面积是震前孤儿学校的4倍多、校舍面积是之前的近7倍。学校拥有现代化的教学楼和配套设施，能满足240名学生的就读需求。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><img id=\"{5927A9B5-AD00-433B-8DAF-D530FABA902A}\" title=\"\" src=\"http://www.xinhuanet.com/world/2018-09/01/129944882_15357697633571n.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><span style=\"color:navy;font-family:楷体\">2012年7月22日，玉树州称多县中刚友谊小学二年级学生在教室内。 新华社记者 张宏祥摄</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"color:navy\"><span style=\"font-weight: 600 !important;\">故事4：坦桑尼亚热播《媳妇的美好时代》</span></span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“近年来，随着中非关系发展，中非人民越走越近。一些非洲朋友活跃在中国文艺舞台上，成了中国家喻户晓的明星。中国电视剧《媳妇的美好时代》在坦桑尼亚热播，使坦桑尼亚观众了解到中国老百姓家庭生活的酸甜苦辣。”</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">——2013年3月25日，习近平主席在坦桑尼亚尼雷尔国际会议中心发表题为《永远做可靠朋友和真诚伙伴》的演讲</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">“故事里的事”：</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　2011年11月21日，斯瓦西里语版中国电视剧《媳妇的美好时代》在坦桑尼亚开播。作为国家广电总局“中国优秀电视剧走进东非”项目的开局之作，斯瓦西里语版36集《媳妇的美好时代》是首部被翻译成非洲本土语言并进行配音、在非洲的国家电视台播出的中国电视剧。该剧在坦桑尼亚由当地最具号召力的人气明星担纲配音、重新演绎。随后，《媳妇的美好时代》很快成为许多非洲国家的热播剧。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><img id=\"{89D00E39-74BA-4D36-9C6C-F8C4C7681CF1}\" title=\"\" src=\"http://www.xinhuanet.com/world/2018-09/01/129944882_15357698202801n.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"color:navy;font-family:楷体\">2013年12月11日，《媳妇的美好时代》法语版首播仪式在塞内加尔国家大剧院举行，图为配音演员在介绍自己在电视剧《媳妇的美好时代》中的角色。 新华社记者 邰剑秋摄</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"color:navy\"><span style=\"font-weight: 600 !important;\">故事5：卢旺达有了规模化的服装厂</span></span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　“中国企业家积极响应卡加梅总统提出的‘卢旺达制造’发展战略，创办的服装公司为卢旺达发展本国制造业作出了积极贡献。”</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">——2018年7月21日，习近平主席在卢旺达《新时代报》发表题为《中卢友谊情比山高》的署名文章</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　<span style=\"font-weight: 600 !important;\">“故事里的事”：</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　卢旺达政府当前正推行“卢旺达制造”计划，旨在提升本国制造业的产量和质量，以本国产品替代进口产品并增加出口。曾经，卢旺达没有真正规模化的服装厂，只有小作坊。2015年，中国人开办的C&amp;H服装厂改变了这一状况，不仅解决了1500多个就业岗位，还为当地服装制造业带来了先进的理念、技术和装备。“撸起袖子加油干！”被翻译成英语和当地语挂在墙上，8000平方米的厂房内工人们各司其职，在21条生产线上井井有条地工作。他们生产的服装20%在卢旺达销售，80%出口欧美国家。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><img id=\"{2F71914A-138D-49AB-8B49-2A293BF463D7}\" title=\"\" src=\"http://www.xinhuanet.com/world/2018-09/01/129944882_15357698703581n.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal; text-align: center;\"><span style=\"color:navy;font-family:楷体\">2018年7月21日，卢旺达工人在繁忙的C&amp;H服装厂车间内工作。新华社记者 饶爱民摄</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　习近平主席讲述的一个个生动鲜活的故事，或暖意融融、或鼓舞人心，传递着中非人民之间的深情厚谊。随着2018年中非合作论坛北京峰会的成功举办，相信更多的中非友好故事将会上演。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(64, 64, 64); font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, å¾®è½¯é›…é»‘, STHeitiSC-Light, simsun, å®‹ä½“, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 18px; white-space: normal;\">　　（据新华社客户端报道　新华社记者：王卓伦）</p><p><span class=\"tj\" style=\"display: block; position: absolute; z-index: 4; left: 0px; top: 0px; padding: 4px 12px; font-size: 14px; background-color: rgb(52, 140, 236); color: rgb(255, 255, 255);\">图集</span><span class=\"origin\" style=\"display: block; position: absolute; z-index: 4; width: 89px; height: 29px; right: 0px; background-image: url(&quot;http://www.newsimg.cn/xl2017/images/origin.png&quot;); cursor: pointer;\"></span></p><p><span class=\"lb-left s_arrow_left\" style=\"display: block; position: absolute; z-index: 4; top: 0px; margin-top: -40px; left: 0px; width: 22px; height: 64px; background-image: url(&quot;http://www.newsimg.cn/xl2017/images/lb-l.png&quot;); cursor: pointer;\"></span><span class=\"lb-right s_arrow_right\" style=\"display: block; position: absolute; z-index: 4; top: 0px; margin-top: -40px; right: 0px; width: 22px; height: 64px; background-image: url(&quot;http://www.newsimg.cn/xl2017/images/lb-r.png&quot;); cursor: pointer;\"></span></p><p><br/></p>', '', '', '2018-09-03 00:00:00', '2018-09-30 00:00:00', '2018-09-03 00:00:00', '1', '1', '2018-09-03 11:50:13', '2018-09-10 11:38:57');
